import './Input.css';
import { useForm } from 'react-hook-form';

// withdraw input
export default function ReturnWithdrAwInput() {

 const { handleSubmit, register, reset } = useForm();
 const onSubmit = async (data) => {

  if (data.phone.length != 13) {
   window.alert('Number Invalid');
  };

  console.log(data);
  reset();
 };

 return (
  <div className='wrp-withdraw-input'>
   <form onSubmit={handleSubmit(onSubmit)}>

    <input type='phone' name='phone' placeholder='$' {...register('phone', { require: true })} />
    <input type='text' placeholder='••••••' name='phone' {...register('phone', { require: true })} />

    <button className='Btn'>Suivant</button>
   </form>
  </div>
 );
};
